import styled from "styled-components";
export const Overlay = styled.div`
    position: abosolute;
`

export const Container = styled.div`
    padding-top: 130px;
    min-height: 100vh;

    display: flex;
    flex-wrap: wrap;
    justify-content: center;

    background-position: left top;
    background-image: url('./img/background.jpg');

    & *{
        color: #f0f8ff;
    }

`;
